import React from "react";
import AppLayout from "../components/layout/AppLayout";
import Link from 'next/link';
import Post from "../components/post/Post";
import { useAuthState } from "../lib/providers/authProvider";      
import axios from "axios";

const Home = ():any => { 
  const me = useAuthState();
  return (
    <AppLayout title="Doraemon" requiredLogin={true}> 
      <Link href="/auth/login">LOGIN</Link>
      {JSON.stringify(me)} 
      <Post/>
    </AppLayout>
  );
};

export async function getServerSideProps(context: any) {
  const res = await axios.get('http://localhost:8080/auth/hakgo');
  console.log(res); 
  console.log("context..", context);
  return {
    props: {test:res.data}, // will be passed to the page component as props
  }
}


export default Home;
